svg.script:

	 var time = 4;		// Originally, it started at 100% power! Now starts at 0%
	 var delta_time = .01;
	 var max_time = 11;

	 function Start(evt) {
// Counting from right-hand end - pairs of cycles are grouped, 't' is trigger pulse shading

		Wave1  = evt.target.ownerDocument.getElementById("g3171");
		Wave2  = evt.target.ownerDocument.getElementById("g3177");  
		Wave3  = evt.target.ownerDocument.getElementById("g3183");  
		Wave4  = evt.target.ownerDocument.getElementById("g3189");  
		Wave5  = evt.target.ownerDocument.getElementById("g3195");  

		Trig1 = evt.target.ownerDocument.getElementById("path3904"); 			// Trigger waveform

		PowerVal = evt.target.ownerDocument.getElementById("tspan3025");

		Hide();
	 }

	function Hide() {
		time = time + 1;
		if (time > max_time)
			time = 0;


		if (time == 1)
		{
			Wave1.setAttribute("fill","#ffffff");
			Trig1.setAttribute("d", "m 5, 242.36218 5,0 0,-15 200,0 0,15 50,0 0,-15 200,0 0,15 50,0 0,-15 20,0");		

			PowerVal.textContent = "80%";

		}
		if (time == 11)
		{
			Wave1.setAttribute("fill","#ff2828");
			Trig1.setAttribute("d", "m 5, 242.36218 5,0 0,-15 520,0");

			PowerVal.textContent = "100%";
		}
		if (time == 7)
		{
			Wave5.setAttribute("fill","#ff2828");
			Trig1.setAttribute("d", "m 5, 242.36218 5,0 0,-15 50,0 0,15 200,0 0,-15 50,0 0,15 200,0 0,-15 20,0");

			PowerVal.textContent = "20%";
		}
		if (time == 2)
		{
			Wave2.setAttribute("fill","#ffffff");
			Trig1.setAttribute("d", "m 5, 242.36218 5,0 0,-15 150,0 0,15 100,0 0,-15 150,0 0,15 100,0 0,-15 20,0");

			PowerVal.textContent = "60%";
		}

		if (time == 8)
		{
			Wave4.setAttribute("fill","#ff2828");
			Trig1.setAttribute("d", "m 5, 242.36218 5,0 0,-15 100,0 0,15 150,0 0,-15 100,0 0,15 150,0 0,-15 20,0");

			PowerVal.textContent = "40%";
		}
		if (time == 3)
		{
			Wave3.setAttribute("fill","#ffffff");
			Trig1.setAttribute("d", "m 5, 242.36218 5,0 0,-15 100,0 0,15 150,0 0,-15 100,0 0,15 150,0 0,-15 20,0");

			PowerVal.textContent = "40%";
		}
		if (time == 9)
		{
			Wave3.setAttribute("fill","#ff2828");
			Trig1.setAttribute("d", "m 5, 242.36218 5,0 0,-15 150,0 0,15 100,0 0,-15 150,0 0,15 100,0 0,-15 20,0");

			PowerVal.textContent = "60%";
		}
		if (time == 4)
		{
			Wave4.setAttribute("fill","#ffffff");
			Trig1.setAttribute("d", "m 5, 242.36218 5,0 0,-15 50,0 0,15 200,0 0,-15 50,0 0,15 200,0 0,-15 20,0");

			PowerVal.textContent = "20%";
		}
		if (time == 10)
		{
			Wave2.setAttribute("fill","#ff2828");
			Trig1.setAttribute("d", "m 5, 242.36218 5,0 0,-15 200,0 0,15 50,0 0,-15 200,0 0,15 50,0 0,-15 20,0");

			PowerVal.textContent = "80%";
		}

		if (time == 5)
		{
			Wave5.setAttribute("fill","#ffffff");
			Trig1.setAttribute("d", "m 5, 242.36218 5,0 520,0");

			PowerVal.textContent = "0%";
		}

// Repeat
		setTimeout("Hide()", 1000)				// every 1 second
	}
	window.animate = Hide;
